import React from 'react';
import './App.css';
import TableProvider from './context/TableProvider';
import Table from './components/Table';
import Search from './components/Search';

function App() {
  return (
    <TableProvider>
      <Search />
      <Table />
    </TableProvider>
  );
}

export default App;
